import {React, useMemo, useState} from 'react';
import * as style from "../../css/light/searchList";
import getDeviceData from "../dataRetrieval/getDeviceData";
import getUserData from "../dataRetrieval/getUserData";
import FocusedList from "./focusedList"
import getDidData from "../dataRetrieval/getDidData";
import getSearch from '../dataRetrieval/getSearch';
import ProfileList from "../profileList/profileList"
import Total from "../total/total"
import ProfileButtons from "../profileButtons/profileButtons"

//Extends Main
export default function SearchList() {
  const profileData = useMemo(() => {return {"device": getDeviceData(), "user": getUserData()}}, [])
  const [listToRender, setListToRender] = useState(["Device", "User"])
  const [profileDataToRender, setProfileDataToRender] = useState(profileData)
  const [totalToRenderNumber, setTotalToRenderNumber] = useState(50)
  const [focused, setFocused] = useState([])

  const handleInputChange = string => {
    setProfileDataToRender(getSearch(string, listToRender, profileData))
  }
    
  return (
    <div style={{display: "flex"}}>
      <div style={{maxWidth: "8vw"}}>
        <ProfileButtons listToRender={listToRender} setListToRender={setListToRender}/>
        <input style={style.searchInputStyle} onChange={e => handleInputChange(e)}/>
        <ProfileList listToRender={listToRender} profileDataToRender={profileDataToRender} totalToRenderNumber={totalToRenderNumber} focused={focused} setFocused={setFocused}/>
        <Total totalToRenderNumber={totalToRenderNumber} setTotalToRenderNumber={setTotalToRenderNumber} profileDataToRender={profileDataToRender} listToRender={listToRender}/>
      </div>
      <div style={{width: "30px", marginLeft: "20px", backgroundColor: "black"}}>
        {/* <div style={{height: "700px", width: "10px", backgroundColor: "black"}}></div> */}
      </div>
      <FocusedList focused={focused} setFocused={setFocused}/>
    </div>
  );
};
